const styles = theme => ({
    title: {
        marginBottom: 0,
        marginLeft: "auto",
        marginRight: "auto",
        transition: theme.transition,
    },
    paragraph: {
        marginTop: 0,
        marginLeft: "auto",
        marginRight: "auto",
        transition: theme.transition,
    }
});

export default styles;
